import React from 'react';
import Footer from '../Footer';

const Community = props => {
  return (
    <>
    <div className='community-container'>
      <div className='community-header'>
          <h1>Open your networking with our Community</h1>
          <p>Welcome to our vibrant community dedicated to fostering connections between passionate individual support workers and discerning recruiters. Whether you're seeking a work placement, volunteering opportunity, part-time, full-time, or casual position, our platform is designed to facilitate meaningful collaborations. Join us in shaping the future of support work, where opportunities abound and talent finds its perfect match!</p>
      </div>
      <button className="button-86">Join us Now</button>

    </div>
    <Footer/>
    </>
  )
}


export default Community
